import './App.css';
import Navbar from './components/Navbar'
import Container from './components/Container'
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  BrowserRouter
}from "react-router-dom";
import React, { useState,useEffect } from 'react';

function App() {
const prevent=(event)=>{
  event.preventDefault();
}
  return (
<>
<BrowserRouter>
<Navbar prevent={prevent}></Navbar>
<Routes>
  <Route element={<Container key="general"></Container>}></Route>
</Routes>
</BrowserRouter>



</>
  );
}

export default App;
